import React, { Fragment } from 'react';
import User from './Profile/UserData';
import Profile from './Profile/Profile';
import Stats from './Stat/Stats';
import PricingPlan from './Pricing/PricingPlan';
import pricingPlanItems from './pricing-plan.json';

const App = () => (
	<Fragment>
		<Profile user={User} />
		<Stats />
		<PricingPlan items={pricingPlanItems} />,
	</Fragment>
);

export default App;
